import React, { Component } from 'react';

class DUISPage extends Component {
    render() {
        return (
            <div>
             <h1>DUIS</h1>
             <p>Being accused of a DUI can be a scary, stressful and expensive experience. Many people are not aware of the consequences of getting charged with a DUI.  Being charged with a DUI case has at least two possible consequences, a criminal case and an administrative action with the department of motor vehicles. There can also be consequences to those who hold any type of state issued licenses, such as real estate agents, brokers, contractors, health care providers and law enforcement personal. The criminal case can result in substantial fines and or jail time and the administrative action can result in loss of license.  Without the right representation, you run the risk of loosing your ability to drive even to work which can put tremendous strain on your life. Attorney John Williams has over three decades of experience helping thousands of people lessen the burden of their offense.  Call him now for a free consultation to discuss your case. Mr. Williams will not take a client if he does not feel that he can help them.  If Mr. Williams represents you for your offense, you can be at ease knowing you have the very best and most experienced attorney to handle your case.</p>
            </div>
        );
    }
}

export default DUISPage;
